import { AuthenticatedTemplate, UnauthenticatedTemplate } from '@azure/msal-react';
import './App.css';
import { ReqUsers } from './components/DataCollection/LoginHandler';
import { GetUsers } from './components/DataCollection/Request';
import { useEffect, useState } from 'react';
import companyLogo from '../src/logo.png'


function App() {
  return (
    <div className="App">
      <AuthenticatedTemplate>
        <div style={{display: 'inline'}}>
          <img src={companyLogo} height="100px" style={{float : 'left', margin: '30px'}}/>
          <h1 style={{marginBottom: '30px'}}>Se hvem der er ledige her:</h1>
        </div>
        <GetUsers />
      </AuthenticatedTemplate>
      <UnauthenticatedTemplate>
        <ReqUsers />
      </UnauthenticatedTemplate>
    </div>
  );
}

export default App;
